import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import { 
  Header, 
  InternalHeader,
  Button,
  Paragraph
} from '@digdir/designsystemet-react';

// Pages
import SearchInterface from './components/SearchInterface';
import FaqChatbot from './pages/FaqChatbot';
import ThemeBuilder from './pages/ThemeBuilder';
import ComponentTips from './pages/ComponentTips';
import SlackChannels from './pages/SlackChannels';
import Changelog from './pages/Changelog';

const App: React.FC = () => {
  return (
    <Router>
      <div>
        <Header>
          <InternalHeader>
            <InternalHeader.Title>Designsystemet Examples</InternalHeader.Title>
          </InternalHeader>
        </Header>

        <nav style={{ padding: '1rem', borderBottom: '1px solid #e5e5e5', marginBottom: '2rem' }}>
          <div style={{ display: 'flex', gap: '1rem', justifyContent: 'center' }}>
            <Button as={Link} to="/" variant="secondary">Search Interface</Button>
            <Button as={Link} to="/faq-chatbot" variant="secondary">FAQ Chatbot</Button>
            <Button as={Link} to="/theme-builder" variant="secondary">Theme Builder</Button>
            <Button as={Link} to="/component-tips" variant="secondary">Component Tips</Button>
            <Button as={Link} to="/slack-channels" variant="secondary">Slack Channels</Button>
            <Button as={Link} to="/changelog" variant="secondary">Changelog</Button>
          </div>
        </nav>

        <main style={{ maxWidth: '1200px', margin: '0 auto', padding: '0 1rem' }}>
          <Routes>
            <Route path="/" element={<SearchInterface />} />
            <Route path="/faq-chatbot" element={<FaqChatbot />} />
            <Route path="/theme-builder" element={<ThemeBuilder />} />
            <Route path="/component-tips" element={<ComponentTips />} />
            <Route path="/slack-channels" element={<SlackChannels />} />
            <Route path="/changelog" element={<Changelog />} />
          </Routes>
        </main>

        <footer style={{ padding: '2rem', textAlign: 'center', marginTop: '2rem', borderTop: '1px solid #e5e5e5' }}>
          <Paragraph>Designsystemet Examples - Interactive Concepts</Paragraph>
        </footer>
      </div>
    </Router>
  );
};

export default App;
